import React from 'react';
import Footer from '../Footer/Footer';
import Appbar from '../Header/Appbar';
import { sizing } from '@material-ui/system';
import { Container } from '@material-ui/core';

const Layout = (props) => {
    return (
        <div>
            <Appbar />
            {props.children}
            <Footer />

        </div>

    );
};

export default Layout;
